    const loadMore = async () => {
        if (!hasMore || loading) return
        // 直接调用loadTaskList，它会自动处理分页
        await loadTaskList()
    }

    const onRefresh = async () => {
        await loadTaskList()
    }

    const renderTaskCard = (task: any) => (
        <Card
            key={task.id}
